(28, 235, NULL, 'A Gateway to The Future', 'The Algeria Pavilion took form as a Voyage of Life, through a rihla or an Arabic form of a travelogue.  It offered each visitor a discovery or Algeria\'s cultural heritage and aspirations for the future.', NULL, '2022-08-29 14:05:06', 1, '2022-08-29 14:11:30', 1, 0, 1, 1, 0),
