(25, 9, '', 'Chapter 1.\r\nIt Started With A Thought', '\"A pen in hand can overcome all odds.\"\r\n  Once a seed of thought from the founder, this has given Pico its pulse to life in 1972.', NULL, NULL, NULL, '2022-08-08 07:17:26', 1, 0, 1, 1, 0),
