(60, 21, '', 'International Accreditations & Certifications', 'Pico’s strength across the world stage has always been the expertise of its people,along with the depth of our understanding of different cultures and industry practices.\r\nPico’s commitment to empower our workforce through independently verified Quality Management System, as well as Sustainability & Environmental Management Systems is evidence of the excellence of Pico’s services.\r\nAn essential industry requirement of continuing maintenance and improving the company’s objectives is the installation of ISOs 9001/ 14001/ 45001/ 20121 complimented by LEED AP credentials, and Forest Stewardship Council License. Pico\'s certification and license standards are developed in co-existence with each other.', NULL, NULL, NULL, '2022-08-08 09:08:24', 1, 0, 1, 1, 0),
