('2eea2c33-57fd-4757-aae3-f60be2e52014', 2, NULL, 'default', 1, 1, 1, 'about-us', 'About Us', '<div class=\"inline_html\" contenteditable=\"false\"><section>\n        <div class=\"section-title\">About us</div>\n        <div class=\"aboutus-cards\">\n            <div class=\"card-panel position-relative pb-7 h-100 m-0 px-3\">\n                <div class=\"position-relative\" style=\"z-index:1;\">\n\n                    <div class=\"number align-items-center circle purple accent-1 white-text justify-content-center large-text d-inline-flex mb-4\">\n                        1</div>\n                    <div class=\"font-weight-bold medium-text\">\n                        Book a timeslot, or walk in.\n                    </div>\n                    <div>\n                        Dress in clothes that you do not mind getting dirty or suit up in our coveralls. Shoe\n                        covers,\n                        hair nets and gloves provided.\n                    </div>\n                </div>\n                <div class=\"bg-img\">\n                    <img src=\"/images/splatter.png\" alt=\"splatter background image\" class=\"responsive-img\">\n                </div>\n            </div>\n            <div class=\"card-panel position-relative pb-7 h-100 m-0 px-3\">\n                <div class=\"position-relative\" style=\"z-index:1;\">\n\n                    <div class=\"number align-items-center circle yellow white-text justify-content-center large-text d-inline-flex mb-4\">\n                        2</div>\n                    <div class=\"font-weight-bold medium-text\">\n                        A short briefing.\n                    </div>\n                    <div>\n                        Our hosts will introduce you to some techniques. It\'s not a class, but might inspire you or\n                        get the creative juices flowing! Choose your paint colours\n                    </div>\n                </div>\n                <div class=\"bg-img\">\n                    <img src=\"/images/splatter.png\" alt=\"splatter background image\" class=\"responsive-img\">\n                </div>\n            </div>\n            <div class=\"card-panel position-relative pb-7 h-100 m-0 px-3 \">\n                <div class=\"position-relative\" style=\"z-index:1;\">\n\n                    <div class=\"number align-items-center circle green white-text justify-content-center large-text d-inline-flex mb-4\">\n                        3</div>\n                    <div class=\"font-weight-bold medium-text\">\n                        Splatter time!\n                    </div>\n                    <div>\n                        Hang your painting straight on our walls or choose to use the tables. Use both! Discover tools\n                        you never knew could be used to create art. Everything is fair game\n                    </div>\n                </div>\n                <div class=\"bg-img\">\n                    <img src=\"/images/splatter.png\" alt=\"splatter background image\" class=\"responsive-img\">\n                </div>\n            </div>\n            <div class=\"card-panel position-relative pb-7 h-100 m-0 px-3\">\n                <div class=\"position-relative\" style=\"z-index:1;\">\n\n                    <div class=\"number align-items-center circle purple accent-1 white-text justify-content-center large-text d-inline-flex mb-4\">\n                        4</div>\n                    <div class=\"font-weight-bold medium-text\">\n                        Canvas completed.\n                    </div>\n                    <div>\n                        \"What seperates the best artists from the good ones is knowing when to stop.\" We made that up.\n                        But only you can decide when your painting is done! Leave it on our racks to dry, and perhaps\n                        create another one.\n                    </div>\n                </div>\n                <div class=\"bg-img\">\n                    <img src=\"/images/splatter.png\" alt=\"splatter background image\" class=\"responsive-img\">\n                </div>\n            </div>\n            <div class=\"card-panel position-relative pb-7 h-100 m-0 px-3\">\n                <div class=\"position-relative\" style=\"z-index:1;\">\n\n                    <div class=\"number align-items-center circle yellow white-text justify-content-center large-text d-inline-flex mb-4\">\n                        5</div>\n                    <div class=\"font-weight-bold medium-text\">\n                        An artist is born.\n                    </div>\n                    <div>\n                        Paintings generally take 48 hours to dry. Come pick up your masterpiece!\n                    </div>\n                </div>\n                <div class=\"bg-img\">\n                    <img src=\"/images/splatter.png\" alt=\"splatter background image\" class=\"responsive-img\">\n                </div>\n            </div>\n        </div>\n\n\n    </section></div><p>[[Gallery:33f55168-f086-46a9-a469-3fbf08ab5312]]</p>', '2022-07-10 10:59:41', '2022-07-17 07:15:03', '{\"meta_description\":null,\"opengraph_title\":null,\"opengraph_description\":null,\"opengraph_image\":null,\"opengraph_image_width\":null,\"opengraph_image_height\":null,\"twitter_title\":null,\"twitter_description\":null,\"twitter_image\":null}', 1),
