('3d5b4d12-a242-47fa-ab02-74519a863ac8', 18, NULL, 'default', 1, 1, 1, 'cookie-policy', 'Cookie Policy', '<h1 class=\"ql-align-justify\">Cookie Policy <span class=\"hljs-keyword\">for</span> Wild Paint House</h1><p class=\"ql-align-justify\"><span class=\"ql-size-large\">    This is the Cookie Policy for Wild Paint House, a website owned and operated by Wild Paint House. This Cookie Policy explains how Wild Paint House uses  and protects any information collected through cookies.</span></p><h2 class=\"ql-align-justify\">What Are Cookies</h2><p class=\"ql-align-justify\">    <span class=\"ql-size-large\">Cookies are small text files that are stored on your computer to help Wild Paint House to provide you with a better experience. Cookies can be  \"persistent\" or \"session\" cookies. Persistent cookies remain on your    computer until you delete them. Session cookies are temporary and are deleted when you close your web browser. As is common practice with almost all professional websites this site uses cookies, which are tiny files that are downloaded to your computer, to improve your experience. This page describes what information they gather, how we use it and why we sometimes  need to store these cookies. We will also share how you can prevent these  cookies from being stored however this may downgrade or \'break\' certain    elements of the sites functionality.</span></p><h2 class=\"ql-align-justify\">How We Use Cookies</h2><p class=\"ql-align-justify\">    <span class=\"ql-size-large\">We use cookies for a variety of reasons detailed below. Unfortunately in    most cases there are no industry standard options for us to choose from.</span></p><p class=\"ql-align-justify\"><br></p><h2 class=\"ql-align-justify\">Disabling Cookies</h2><p class=\"ql-align-justify\">   <span class=\"ql-size-large\"> You can prevent most of the Cookies from being stored by adjusting the    settings on your browser.</span></p><h2 class=\"ql-align-justify\">The Cookies We Set</h2><p class=\"ql-align-justify\">  <span class=\"ql-size-large\">  </span><strong class=\"ql-size-large\">Email newsletters related cookies</strong><span class=\"ql-size-large\"> - This site offers    newsletter or email subscription services and cookies may be used to    remember if you are already registered and whether to show certain    notifications which might only be valid to subscribed/unsubscribed users.</span></p><p class=\"ql-align-justify\">   <span class=\"ql-size-large\"> </span><strong class=\"ql-size-large\"> Forms related cookies </strong><span class=\"ql-size-large\"> - When you submit data to through a  form such as those found on contact pages or comment forms cookies may be  set to remember your user details for future correspondence.</span></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><span class=\"ql-size-large\">    </span><strong class=\"ql-size-large\"> Third Party Cookies </strong><span class=\"ql-size-large\"> - In some special cases we also use cookies provided by trusted third    parties. The following section details which third party cookies you might    encounter through this site.</span></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><span class=\"ql-size-large\">    This site uses Google Analytics which is one of the most widespread and    trusted analytics solution on the web for helping us to understand how you    use the site and ways that we can improve your experience. These cookies may    track things such as how long you spend on the site and the pages that you    visit so we can continue to produce engaging content.</span></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><span class=\"ql-size-large\">    For more information on Google Analytics cookies, see the official Google  Analytics page.</span></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><span class=\"ql-size-large\">    As we sell products it\'s important for us to understand statistics about how  many of the visitors to our site actually make a purchase and as such this  is the kind of data that these cookies will track. This is important to you  as it means that we can accurately make business predictions that allow us  to monitor our advertising and product costs to ensure the best possible  price.</span></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><span class=\"ql-size-large\">    We also use social media buttons and/or plugins on this site that allow you  to connect with your social network in various ways. For these to work the following social media sites including; {List the social networks whose  features you have integrated with your site?:12}, will set cookies through  our site which may be used to enhance your profile on their site or   contribute to the data they hold for various purposes outlined in their    respective privacy policies.</span></p><h2 class=\"ql-align-justify\">More Information</h2><p class=\"ql-align-justify\"><span class=\"ql-size-large\">    Hopefully that has clarified things for you and as was previously mentioned   if there is something that you aren\'t sure whether you need or not it\'s  usually safer to leave cookies enabled in case it does interact with one of   the features you use on our site.</span></p><p class=\"ql-align-justify\"><span class=\"ql-size-large\">For more general information on cookies, please read the Cookies Policy  article.</span></p><p class=\"ql-align-justify\"><span class=\"ql-size-large\">However if you are still looking for more information then you can contact  us through one of our preferred contact methods: Email:  info@wildpainthouse.com</span></p><p class=\"ql-align-justify\"><br></p>', '2022-07-26 14:44:36', '2022-10-05 04:11:19', '{\"meta_description\":null,\"opengraph_title\":null,\"opengraph_description\":null,\"opengraph_image\":null,\"opengraph_image_width\":null,\"opengraph_image_height\":null,\"twitter_title\":null,\"twitter_description\":null,\"twitter_image\":null}', 0),
