s page, and/or update the Terms of Service modification date below.</p><p>Modifications to Our websiteWild Paint House reserves the right to modify, suspend or discontinue, temporarily or permanently, the website or any service to which it connects, with or without notice and without liability to you.</p><p>Updates to Our websiteWild Paint House may from time to time provide enhancements or improvements to the features/ functionality of the website, which may include patches, bug fixes, updates, upgrades and other modifications (\"Updates\").</p><p>Updates may modify or delete certain features and/or functionalities of the website. You agree that Wild Paint House has no obligation to (i) provide any Updates, or (ii) continue to provide or enable any particular features and/or functionalities of the website to you.</p><p>You further agree that all Updates will be (i) deemed to constitute an integral part of the website, and (ii) subject to the terms of service of this Agreement.</p><p>Third-Party ServicesWe may display, include or make available third-party content (including data, information, applications and other products services) or provide links to third-party websites or services (\"Third- Party Services\").</p><p>You acknowledge and agree that Wild Paint House shall not be responsible for any Third-Party Services, including their accuracy, completeness, timeliness, validity, copyright compliance, legality, decency, quality or any other aspect thereof. Wild Paint House does not assume and shall not have any liability or responsibility to you or any other person or entity for any Third-Party Services.</p><p>Third-Party Services and links thereto are provided solely as a convenience to you and you access and use them entirely at your own risk and subject to such third parties\' terms of service.</p><p>Term and TerminationThis Agreement shall remain in effect until terminated by you or Wild Paint House.</p><p>Wild Paint House may, in its sole discretion, at any 