 intended results, be compatible or work with any other software, , systems or services, operate without interruption, meet any performance or reliability standards or be error free or that any errors or defects can or will be corrected.</p><p>Without limiting the foregoing, neither Wild Paint House nor any Wild Paint House\'s provider makes any representation or warranty of any kind, express or implied: (i) as to the operation or availability of the website, or the information, content, and materials or products included thereon; (ii) that the website will be uninterrupted or error-free; (iii) as to the accuracy, reliability, or currency of any information or content provided through the website; or (iv) that the website, its servers, the content, or e-mails sent from or on behalf of Wild Paint House are free of viruses, scripts, trojan horses, worms, malware, timebombs or other harmful components.</p><p>Some jurisdictions do not allow the exclusion of or limitations on implied warranties or the limitations on the applicable statutory rights of a consumer, so some or all of the above exclusions and limitations may not apply to you.</p><p>Limitation of LiabilityNotwithstanding any damages that you might incur, the entire liability of Wild Paint House and any of its suppliers under any provision of this Agreement and your exclusive remedy for all of the foregoing shall be limited to the amount actually paid by you for the website.</p><p>To the maximum extent permitted by applicable law, in no event shall Wild Paint House or its suppliers be liable for any special, incidental, indirect, or consequential damages whatsoever (including, but not limited to, damages for loss of profits, for loss of data or other information, for business interruption, for personal injury, for loss of privacy arising out of or in any way related to the use of or inability to use the website, third-party software and/or third-party hardware used with the website, or otherwise in connection with any provision of this Agreement), even if Wild Paint House or any supplier has been advised of the possibility of such damages and even if the remedy fails of its essential purpose.</p><p>Some states/jurisdictions do not allow the exclusion or limitation of incidental or consequential damages, so the above limitation or exclusion may not apply to you.</p><p>SeverabilityIf any provision of this Agreement is held to be unenforceable or invalid, such provision will be changed and interpreted to accomplish the objectives of such provision to the greatest extent possible under applicable law and the remaining provisions will continue in full force and effect.</p><p>WaiverExcept as provided herein, the failure to exercise a right or to require performance of an obligation under this Agreement shall not effect a party\'s ability to exercise such right or require such performance at any time thereafter nor shall be the waiver of a breach constitute waiver of any subsequent breach.</p><p>Amendments to this AgreementWild Paint House reserves the right, at its sole discretion, to modify or replace this Agreement at any time. If a revision is material we will provide at least 30 days\' notice prior to any new terms taking effect. What constitutes a material change will be determined at our sole discretion.</p><p>By continuing to access or use our website after any revisions become effective, you agree to be bound by the revised terms. If you do not agree to the new terms, you are no longer authorized to use Wild Paint House.</p><p>Entire AgreementThe Agreement constitutes the entire agreement between you and Wild Paint House regarding your use of the website and supersedes all prior and contemporaneous written or oral agreements between you and Wild Paint House.</p><p>You may be subject to additional terms of service that apply when you use or purchase other Wild Paint House\'s services, which Wild Paint House will provide to you at the time of such use or purchase.</p><p>DisclaimerWild Paint House is not responsible for any content, code or any other imprecision.</p><p>Wild Paint House does not provide warranties or guarantees.</p><p>In no event shall Wild Paint House be liable for any special, direct, indirect, consequential, or incidental damages or any damages whatsoever, whether in an action of contract, negligence or other tort, arising out of or in connection with the use of the Service or the contents of the Service. The Company reserves the right to make additions, deletions, or modifications to the contents on the Service at any time without prior notice.</p><p>Contact Us</p><p>Don\'t hesitate to contact us if you have any questions.</p><p>Via Email: info@wildpainthouse.com</p>', '2022-07-26 15:15:27', '2022-10-05 03:48:39', '{\"meta_description\":null,\"opengraph_title\":null,\"opengraph_description\":null,\"opengraph_image\":null,\"opengraph_image_width\":null,\"opengraph_image_height\":null,\"twitter_title\":null,\"twitter_description\":null,\"twitter_image\":null}', 0),
('7bc0703d-30f5-444d-b828-26ae2438581d', 8, NULL, 'default', 1, 1, 0, 'contact-us', 'Contact us', '<div class=\"text-center my-5\">\n        <div class=\"section-title\">contact us</div>\n    </div>\n<section class=\"purple\">\n    <div class=\"success-overlay w-100 h-100 text-white container text-center\">\n        <h3>Thank you for reaching out!</h3>\n        <p class=\"regular-text\">A member of our team will be in touch with you within 24 hours.\n        </p>\n    </div>\n    <form action=\"/api/contact-us/submit\" method=\"post\" class=\"_contactForm\" onsubmit=\"inquire(this,event)\">\n        <div class=\"row container \">\n                <div class=\"col s12\">\n                    <div class=\"section-title text-white\">contact us</div>\n                </div>\n                <div class=\"col s12 m6 px-0 px-m-3\">\n                    <div class=\"input-field\">\n                        <input type=\"text\" name=\"name\" placeholder=\"Name\" class=\"validate invalid\" required>\n                        <span class=\"helper-text\" data-error=\"Required\" data-success=\"Looks Good\"></span>\n\n                    </div>\n                    <div class=\"input-field\">\n                        <input type=\"email\" name=\"email\" placeholder=\"Email\" class=\"validate invalid\" required>\n                        <span class=\"helper-text\" data-error=\"Required\" data-success=\"Looks Good\"></span>\n\n                    </div>\n                    <div class=\"input-field\">\n                        <input type=\"text\" name=\"contact\" placeholder=\"Contact Number\" class=\"validate invalid\" required>\n                        <span class=\"helper-text\" data-error=\"Required\" data-success=\"Looks Good\"></span>\n\n                    </div>\n                    <div class=\"input-field\">\n                        <textarea name=\"message\" class=\"materialize-textarea\" style=\"height:106px\"\n                            id=\"message\" placeholder=\"Message\"></textarea>\n                        <span class=\"helper-text\" data-error=\"Required\" data-success=\"Looks Good\"></span>\n                    </div>\n                </div>\n                <div class=\"col s12 m6 px-0 px-md-3\">\n                    <div class=\"col s12\">\n                        <div class=\"row text-center mb-0\">\n                            <div class=\"input-field col s12\">\n                                <img class=\"captcha-box\" alt=\"captcha\" src=\'/api/captcha\' onclick=\"reloadCaptcha()\" />\n                                <p class=\"small-text\">Click on the captcha to reload</p>\n                                <input type=\"text\" class=\"input-border validate invalid\"\n                                    placeholder=\"Type the text displayed above\" name=\"captcha\">\n                                <span class=\"helper-text\" data-error=\"Required\" data-success=\"Looks Good\"></span>\n\n                            </div>\n                        </div>\n                    </div>\n                    <div class=\"col s12\">\n                        <label>\n                            <input type=\"checkbox\" name=\"subscribed\" checked=\"checked\" />\n                            <span class=\"text-white\">Receive Updates from us</span>\n                        </label>\n\n                    </div>\n                    <div class=\"col s12\">\n\n                        <span class=\"text-white\">By pressing \"send\", you agree to our terms and conditions</span>\n                    </div>\n                    <div class=\"col s12 mt-3\">\n                        <button class=\"btn btn-success w-100 green waves-effect waves-light\" type=\"submit\">Send <i\n                                class=\"wildpaint sm send text-white\"></i>\n                        </button>\n                    </div>\n                </div>\n            </div>\n    </form>\n\n</section>\n<div class=\"text-center my-5\">\n    <div class=\"section-title\">Our Location</div>\n</div>\n<a href=\"https://www.google.com/maps/place/Wild+Paint+House/@25.1344139,55.2268825,15z/data=!4m5!3m4!1s0x0:0x8d3611973ef83cf1!8m2!3d25.1344139!4d55.2268825?shorturl=1\" target=\"_blank\">\n    <img class=\"w-100\" src=\"/images/map.png\" alt=\"Location Map\">\n</a>', '2022-07-11 11:20:34', '2022-10-05 04:35:34', '{\"meta_description\":null,\"opengraph_title\":null,\"opengraph_description\":null,\"opengraph_image\":null,\"opengraph_image_width\":null,\"opengraph_image_height\":null,\"twitter_title\":null,\"twitter_description\":null,\"twitter_image\":null}', 1),
