INSERT INTO `wink_posts` (`id`, `slug`, `title`, `excerpt`, `body`, `published`, `publish_date`, `featured_image`, `featured_image_caption`, `author_id`, `created_at`, `updated_at`, `meta`, `markdown`) VALUES
('6de4fe4b-f0db-4926-9124-b52fed210f2c', 'art-jamming-as-a-social-activity', 'Art Jamming as a Social Activity', '', '<p>Professional artists may work alone, deep in their zone, but Wild Paint House is a place for fun art-jamming, as much a social experience as it is a place to create your next masterpiece.&nbsp;</p><p>Break away from your usual haunt and give art jamming at Wild Paint House a go.&nbsp;</p><p><strong class=\"ql-size-large\">Couples and Dates</strong></p><p>Nothing screams ‘second date’ like a unique, fun-filled first date at Wild Paint House. Admire each other’s hidden artistic ability or break the ice over your lack of. It’s a judgment-free zone, where the point is to have fun! Throw paint at your canvas, leave the mark on the walls, even fling some at each other.&nbsp;</p><p>In a relationship and running out of date ideas? Indulge your art-loving partner with an activity he or she will appreciate, and create shared memories, or literally a shared masterpiece. There’s nothing more intimate than creating something yourself together. One of our favorite moments at Splat Paint House in Singapore was hosting a surprise proposal… followed quite shortly by another!&nbsp;</p><p><strong><img src=\"https://lh4.googleusercontent.com/j53ylIGZ_4h4Obpxu54QrfJ8Ijobxq8js66hdYlxreiygpbEF6J2i3Ov44RWATT0qbsvXJGpmbQS2f-Z2CHXd_fclV9Of0dxe__Hvoe8uEkiQgLySDF8fvAXLXdU3ZX1d6BQfyfI_lVK_OtlikUYFUIf-X_BV2R3ljSXej0AQhiDydDWesx-yCWPQA\"></strong></p><p><strong class=\"ql-size-large\">Friends &amp; Family</strong></p><p>The activities at Wild Paint House are designed for people of all backgrounds (yes we mean it) and ages in mind. Grab your crew and spend a few hours dancing and laughing as you splatter, spin, or UV paint, and make immediate plans for the next session to try something else. You might know which of your friends is the ‘artistic’ one in the group, but unearth the hidden artist in your midst who probably did not know it about him/herself.&nbsp;</p><p>Kids are not left out at Wild Paint House either. We have children-sized gear and machines for every age. Bring the grandparents for some multi-generational fun, it’s an experience your family will remember fondly for life, and with some new paintings to remind you of it at home. Or it might even become a regular outing you can all look forward to!</p><p><strong><img src=\"https://lh3.googleusercontent.com/gQVCYo6BdawN9-JQLDOj1kI4g6Qow1-5e1mNjpow095IgYd1BhaF_i3bx8N2sufj26uKZsNvMi5uMmxaRs4hwk_bibXKETrfFBpeMNhpBoLq3_uN5v3ga3UWWYLP0zSUWKdfrkmGPEOmpnVL8NhuqpUz9Lq4HQuzPJzpYKIDksC6RyOXffEeutLI3g\"></strong></p><p>You can even privatize our entire space to celebrate special events like birthdays or hens dos - children will be right in their element, while there’s nothing more joyful for an adult than feeling like a kid again.</p><p><strong><img src=\"https://lh5.googleusercontent.com/zoWiapWagyM0KV23vTPdv3Z3GtcQvC31h9T-g3hA3Bl8afJQq9ND67WfAZ5tib1rc8EFemVlWDuO6Yk_uj7_PayTsgJJKMglHYo-UKilfuiIKX6j6oNyUIZYh5YdPBxR8RAuo-n5UWnHEEVIzfuzK4cMr7chudrt3EFwiQIlRoBINm5SITsjjZ-5Cg\"></strong></p><p><br></p><p><br></p>', 0, '2022-07-11 12:53:00', '/storage/wink/images/IWSw0HbTMJ33NqKLDJJDcTpko6Qis7CmtTS2vnnN.png', '', 'e8fc6e70-6e9e-4f88-8dd8-bcdd775356ad', '2022-07-11 08:53:39', '2022-09-28 21:52:00', '{\"meta_description\":null,\"opengraph_title\":null,\"opengraph_description\":null,\"opengraph_image\":null,\"opengraph_image_width\":null,\"opengraph_image_height\":null,\"twitter_title\":null,\"twitter_description\":null,\"twitter_image\":null}', 0),
('7ef47abd-86af-4832-a1d2-ba13aaa2902a', 'the-history-of-spin-art', 'The History of Spin Art', '', '<p>Spin Art at Wild Paint House is not just Science or our genius design of machines, it goes way back...</p><p><strong class=\"ql-size-large\">Notable Spin Art Artists</strong></p><p>Since the 1960s spin art can be seen in the works of certain contemporary artists. The artists often have to build their own machines to achieve the speed they desire and accommodate large canvases. With the rise of the internet, it has taken on a performative element.</p><p><a href=\"https://www.damienhirst.com/texts1/series/spins\" rel=\"noopener noreferrer\" class=\"ql-size-large\"><strong>Damien Hirst</strong></a></p><p>Damien Hirst first discovered spin paintings when he was nine years old. “Every time they’re finished, I’m desperate to do another one,” he once said of his spin paintings. For Hirst, the chaotic, circular movement of these works represent life itself, and the accessibility of the spin painting technique showed that anyone can be an artist. The late rock legend David Bowie famously came to Hirst’s studio to collaborate on a spin painting in 1995.</p><p class=\"ql-align-center\"><strong><img src=\"https://lh6.googleusercontent.com/wVPNvvJDKCANDpnadobVMb1adwsZjxKLZy5TLmBKo8xHET-git6vxCWsWr9CqxOJcZ8CoxFogeqZcS8pQ4Hf8HJti1YY65dq4dbGxsXquelZBGikUZKm_3wjy70UaMM2sosoxDbhpEv_VwuBZvP01-Y\"></strong></p><h3><a href=\"https://www.swarez.co.uk/spin-art/\" rel=\"noopener noreferrer\"><strong>Swarez</strong></a></h3><p class=\"ql-align-center\"><strong><img src=\"https://lh4.googleusercontent.com/KYghb0rEK1H_tZPd6I0ZH_FNVnp_2zRbkYKLbwnQATMk-KkhrSR2jyuuWvD7vlC84Zwj22SO0tZGrWlA318rvon4MyfG5bX0jyQ5ISkqNt4GmNYj4sEBSSYvyNAFsL636JN4l7teGUcyF1eR9wJsLUc\"></strong></p><p>Swarez is a self-taught British artist using enamel paints to create large pieces of Spin Art using a custom-made rotating table capable of taking the weight of a human.</p><h3><a href=\"https://callenschaub.com/pages/videos\" rel=\"noopener noreferrer\"><strong>Callen Schaub</strong></a></h3><p class=\"ql-align-center\"><strong><img src=\"https://lh5.googleusercontent.com/9h6-JdP4CbKe-4BGHohB1e0QHvElwLvCvQq2lGZx1mX_qnIsDbJJqq0aPfUz8DGrFiGkE9m69qckszj5ekXrqVHpaMsUiNFc4xORK1ZlWD9fx6N3xahYCeoqCzHJW74FS0qA99wr1xyMk5LnoeB2b1U\"></strong></p><p>Callen Schaub is an artist based in Montreal, Canada. He is recognized for his vibrant paintings using trapezes, pendulums, and spinning machines. Schaub openly shares his painting process with viewers and inspires fans everywhere to participate in his \"Fake Art\" movement. He treats his process almost like a performative piece and has turned them into NFTs.</p><p>The three featured artists are accomplished - it takes thousands of hours of practice, tinkering and exploration to reach the level of control and skill that they have. Yet what they have in common is a punk, Rock &amp; Roll attitude - the embracing of life’s uncertainties, and the unpredictability of giving up control to a spinning disc. Try it! You’ll fall in love with spin art at Wild Paint House.</p>', 1, '2022-04-11 13:24:00', '/storage/wink/images/IqvA3Dfc3fBsHvOBti8pPWVbgXdfcAf8Hjvc0bs1.jpg', '', 'e8fc6e70-6e9e-4f88-8dd8-bcdd775356ad', '2022-07-11 09:24:51', '2022-09-28 21:48:52', '{\"meta_description\":null,\"opengraph_title\":null,\"opengraph_description\":null,\"opengraph_image\":null,\"opengraph_image_width\":null,\"opengraph_image_height\":null,\"twitter_title\":null,\"twitter_description\":null,\"twitter_image\":null}', 0),
('9ee66349-a1f9-4592-91cb-e6c8277750cc', 'how-anyone-can-be-an-artist-at-wild-paint-house', 'How Anyone Can Be An Artist at Wild Paint House', '', '<p><strong><img src=\"https://lh3.googleusercontent.com/sEx3wWnqXDYdOysp-x0gY4Tcogm9rPCDWc0FBjohqmDuJq7Zst0N65OBsIp7Xq_GhALwmukjxRA08BhwEr9ssPOGR51yPw_MP28uz_YutG_EUkGcYioCIqJJGCm8HP_MY_OkvbJbcT1q-xzDBUO6twa2bTjAa6_4usZ5gskc1rv0yDI1vqSyDBVyow\"></strong></p><p>Have you ever been intimidated by a blank canvas? Art can be a daunting endeavor to many people, as our encounter of it might be limited to graded classes in school, where we never scored above a solid B+, or admiring masterpieces in a museum. Yet, making art does not have to be limited to the skilled, and it should definitely not be something scary or boring. Wild Paint House was started by someone who would not win any Pictionary games, yet loves the free, creative environment we set out to create dedicated to abstract art</p><p>We have all seen paintings sell for millions of dollars and thought “What, really?”. At the same time, I have been moved by the creations of someone completely unknown, selling their art at a humble street market, or a piece created at Wild Paint House. Art is subjective, and the value and beauty of a piece should not be measured by the price tag it commands.&nbsp;</p><p><strong><img src=\"https://lh6.googleusercontent.com/TWoLT-4v4qgPjbqtyoZPr5GcbBfgN1QqP8Ve25jQLxmtvFL5kOg63MO7gSl0_6Nv83akJa7H7-qKoXMPhEr0o0dYQ2Rzm1NEmIRKac_v7hk8boPk6RbsG2p12kxjspw11iM4g2YnOGzZ0JDknKldYYCYfBDzRvrFvjtgTvRTsE-ZaWCWy3LaCwMEDg\"></strong></p><p><br></p><p>Instead, at Wild Paint House, we believe that making art is all about leaning into your creativity, and embracing the freedom of expression. What colors are you feeling today, and what tools or techniques would you like to try? There is no right or wrong, and as you explore the process, you’ll start to realize that it’s really not that difficult after all. Your first time splatter painting or spin painting will definitely be fun, but you may feel a little lost. That’s normal! We did not learn to ride a bike or even something as simple as walking, without the first experience where we might have fallen flat on our face. The second canvas onwards, you would have developed more awareness - a better understanding of the possibilities and how the paint interacts with the canvas, and you’ll feel more in control. However, it all starts with the first step of recognizing the creativity that lives within you.</p><p><br></p><p>There is no right or wrong way to make art at Wild Paint House - everyone’s process is unique. Don’t be afraid to take risks and experiment, to push it one step further, but also know when to stop. Art develops your life skills in creativity, risk-taking, being open-minded, and that’s how you will grow as an artist and a person.&nbsp;</p><p><br></p>', 1, '2022-07-22 19:50:00', '/storage/wink/images/Nj0kKG9FOxtOkVE1ZMzNI2JzT0j9vDWRy0QE6jYC.png', '', 'e8fc6e70-6e9e-4f88-8dd8-bcdd775356ad', '2022-07-22 15:50:57', '2022-09-28 21:47:08', '{\"meta_description\":null,\"opengraph_title\":null,\"opengraph_description\":null,\"opengraph_image\":null,\"opengraph_image_width\":null,\"opengraph_image_height\":null,\"twitter_title\":null,\"twitter_description\":null,\"twitter_image\":null}', 0),
('d7c5ec59-cbb7-4367-ae21-b69958ed8239', 'splatter-painting-to-free-your-mind', 'Splatter Painting to free your mind', '', '<p>Drip, drop, splat! Jackson Pollock may be the most well-known action painter of our time, but everyone can have fun with splatter painting at Wild Paint House!&nbsp;</p><p><strong><img src=\"https://lh6.googleusercontent.com/d69KFuA39heMHxQpo1XXnkTMmmXXxk8Zs5lu3n-ppiEluO3F4IvmNOkwTtm3XY0fL_hlosy0c5b035im3-edM8CZ0sI0Jkub8NkPrKvtfJIqXUpiyJybDMsJ-ExFzC8h-vgW2f7AR6vbjhJxGSVa57EGGJmsXgSKgI7ToIRGC23uZppWJjies5ypBw\"></strong></p><p>There are no guidelines on which color to use first, whether to use a base coat, how much of it or any other tricks. The basics are simple: harder motions get you longer, drawn out splatters that dance across the canvas, lighter flicks get you shorter drips. Short, hard movements produce bigger, heavier splashes of paint. It is easy, but your arms might start to feel it for sure. Take a dance break, get in some moves, and pick up where you left off! You can even request for your favorite song at Wild Paint House, and we just may play it for you.</p><p>“Every so often, a painter has to destroy painting. Cézanne did it, Picasso did it with Cubism and then Pollock did it. He busted our idea of a picture all to hell. Then there could be new paintings again.” Such are the words of Dutch-American Abstract Expressionist, Willem de Kooning. His statement still holds true today, there is a pre-Pollock era of modern art and a post-Pollock era.</p><p>While he belongs in the art genre of ‘abstract expressionism’, Pollock believed that drip painting worked as self discovery and one must paint who they are rather than what they want to see. His process resembles performance art, it’s more like a dance. By working around the painting’s edges and eventually standing on it, he can physically enter the same realm as his art. He did not only use paintbrushes, sometimes using sticks and even towels. Similarly, at Wild Paint House splatter paint sessions, we provide you with tools you would never have used with paint before - syringes, water guns and string, just to name a few - and the ways to use them are endless.</p><p>These days many of us are under great pressure from society. It is hard to free your mind and express yourself. Jackson Pollock\'s art was all about being in the moment and focusing on the act of making art more than what the final product would look like. At Wild Paint House, we believe wholeheartedly in such a philosophy. It is a space dedicated to unwind, for you to leave feeling slightly lighter than when you first stepped in. Don’t take our word for it, book your first splatter painting session today!</p><p><br></p>', 1, '2022-07-31 09:26:00', '/storage/wink/images/6pZ1owS4GkEkUdMmvLJr63waT88ZJJzUJAVxLZfC.png', '', 'e8fc6e70-6e9e-4f88-8dd8-bcdd775356ad', '2022-07-31 13:26:11', '2022-09-28 21:54:44', '{\"meta_description\":null,\"opengraph_title\":null,\"opengraph_description\":null,\"opengraph_image\":null,\"opengraph_image_width\":null,\"opengraph_image_height\":null,\"twitter_title\":null,\"twitter_description\":null,\"twitter_image\":null}', 0);

